content.css:
html,
body {
  width: 100%;
  padding: 0;
  margin: 0;
}
html *,
body *,
html *::before,
body *::before,
html *::after,
body *::after {
  box-sizing: border-box;
}
::-webkit-scrollbar {
  width: 10px;
  height: 10px;
}
::-webkit-scrollbar-thumb {
  background-color: rgba(2, 66, 30, 0.527);
  border-radius: 200px;
}
#sandbox-host {
  overflow: auto !important;
}
table {
  width: auto;
  /* La tabla se ajustará al contenido en lugar del contenedor */
  table-layout: auto;
  /* Deja que el ancho de cada columna dependa de su contenido */
  border-collapse: collapse;
  /* Opcional: Une los bordes para que se vea mejor */
  border-spacing: 0px;
  border: 0px;
  width: 100%;
}
table * {
  text-align: left;
}
table > thead {
  position: relative;
}
table > thead::before {
  background: #ffffff;
  background: -moz-linear-gradient(180deg, rgba(255, 255, 255, 0) 52%, rgba(0, 0, 0, 0.18539916) 100%);
  background: -webkit-linear-gradient(180deg, rgba(255, 255, 255, 0) 52%, rgba(0, 0, 0, 0.18539916) 100%);
  background: linear-gradient(180deg, rgba(255, 255, 255, 0) 52%, rgba(0, 0, 0, 0.18539916) 100%);
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  content: '';
  pointer-events: none;
  z-index: 1;
}
table > tbody > tr {
  transition: background-color 0.3s ease-in-out;
}
table > tbody > tr:nth-child(even) {
  background: #F3F2F1;
}
table > tbody > tr:nth-child(odd) {
  background: #fff;
}
table > tbody > tr:hover {
  background: #e1e1e1;
}
.content-details,
.content-columns-values {
  list-style: none;
  padding: 0;
  margin: 0;
}
.content-details li,
.content-columns-values li {
  padding: 7px 15px;
}
