.table * {
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -khtml-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
}
.table .row {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -ms-flex-wrap: wrap;
  flex-wrap: wrap;
  height: 100%;
  -webkit-box-align: stretch !important;
  -ms-flex-align: stretch !important;
  align-items: stretch !important;
}
.table .cell {
  overflow: hidden;
  max-width: 100%;
  padding: 7px;
}
.table.border_bottom .row {
  border: none;
  border-bottom: 1px solid #ddd;
}
.table.border_bottom .row:last-child {
  border: none !important;
}
.table .cell {
  position: relative;
}
.table .cell.top {
  display: flex;
  align-items: center;
}
.table .cell.top.resizable {
  position: relative;
}
.table .cell.top::before {
  content: '';
  position: absolute;
  pointer-events: none;
  transition: background-color 0.3s ease-in-out;
  width: 100%;
  height: 100%;
  z-index: 2;
  top: 0;
  left: 0;
}
.table .cell.top:hover::before {
  background-color: rgba(0, 0, 0, 0.078);
}
.table .cell.top.resizable::after {
  content: '';
  position: absolute;
  top: 0;
  right: 0;
  width: 2px;
  height: 100%;
  background-color: transparent;
  cursor: ew-resize;
  z-index: 1;
}

#ANSlogbox {
  display: block;
  width: 100%;
  position: absolute;
  bottom: 0;
  left: 0;
  z-index: 999999;
  cursor: default;
  background-color: #131c26;
  margin: 0;
  height: 1px;
  padding: 15px 0;
}
#ANSlogbox h1 {
  color: #1b99d2;
  font-size: 21px;
  padding: 0 0 0 35px;
  position: relative;
}
#ANSlogbox h1::before {
  content: "⎆";
  position: absolute;
  font-size: 38px;
  top: -10px;
  left: 0px;
}
#ANSlogbox textarea {
  width: 100%;
  font-size: 20px;
  height: 100px;
  display: block;
  background-color: #dbe8fb;
  color: #616161;
  border: #aeaeae solid 1px;
  resize: none;
  padding: 15px;
}
#ANSlogbox #maximize_icon {
  right: 80px;
  display: none;
}
#ANSlogbox #show_hidden {
  right: 30px;
  display: block;
}
#ANSlogbox #maximize_icon,
#ANSlogbox #show_hidden {
  position: absolute;
  top: -26px;
  color: #fff;
  width: 110px;
  text-align: center;
  font-size: 17px;
  border-radius: 7px 7px 0 0;
  font-weight: 400;
  cursor: pointer;
}
#ANSlogbox #maximize_icon::before {
  content: "⇱";
}
#ANSlogbox #show_hidden::before {
  content: "🞁 Debugger";
}
#ANSlogbox.open {
  height: 30%;
}
#ANSlogbox.open.maximize {
  position: absolute;
  top: 15px;
  left: 15px;
}
#ANSlogbox.open.maximize #maximize_icon::before {
  content: "⇲" !important;
}
#ANSlogbox.open.maximize #maximize_icon {
  background-color: rgba(33, 129, 238, 0.4);
  font-size: 20px;
  border-radius: 0 !important;
  top: 0px !important;
  right: 65px !important;
}
#ANSlogbox.open.maximize #show_hidden {
  background-color: rgba(255, 0, 0, 0.4);
  font-size: 20px;
  border-radius: 0 !important;
  top: 0px !important;
  right: 15px !important;
}
#ANSlogbox.open #maximize_icon {
  background-color: #131c26;
  font-size: 21px;
  height: 30px;
  top: -28px;
  width: 50px !important;
  display: block;
}
#ANSlogbox.open #show_hidden {
  background-color: #131c26;
  font-size: 21px;
  height: 30px;
  top: -28px;
  width: 50px !important;
}
#ANSlogbox.open #ANS_console_content {
  display: block;
}
#ANSlogbox.open #show_hidden::before {
  content: "✕";
}
#ANSlogbox.open #maximize_icon:hover {
  background-color: #217fee;
  color: #fff;
}
#ANSlogbox.open #show_hidden:hover {
  background-color: #FF0000;
  color: #fff;
}
#ANSlogbox:not(.open) #show_hidden {
  background-color: #547ddf;
}
#ANSlogbox #ANS_console_content {
  font-family: Courier, "Lucida Console", monospace;
  font-size: 18px;
  letter-spacing: 0.1em;
  background-color: transparent;
  color: #fff;
  display: none;
  display: block;
  width: 100%;
  height: auto;
  cursor: text;
  -webkit-user-select: text !important;
  /* Safari */
  -ms-user-select: text !important;
  /* IE 10 and IE 11 */
  user-select: text !important;
  /* Standard syntax */
}
